import React, { Component } from "react";
import { Card, Col, CardBody, Button, Row, Container } from "reactstrap";
import ServiceWorker from "../../services/user-service";

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tasks: [],
      message: "",
      beer: "",
      modal: false
    };
  }

  onChange = e => {
    this.setState({ [e.target.name]: e.target.value });
  };

  componentDidMount() {
    this.getTasks();
  }

  getTasks = () => {
    let listTasks = [];
    ServiceWorker.getTasks().then(response => {
      console.log(response);
      response.forEach(data => {
        listTasks.push({
          id: data._id,
          task: data.task,
          status: data.status
        });
      });
    });
  };

  toggle = () => {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  };

  render() {
    return (
      <>
        <Container fluid>
          <Row>
            <Col xs={12}>
              <Card>
                <CardBody>
                  <Row>rqegaiaermn</Row>
                </CardBody>
              </Card>
            </Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default Dashboard;
